import React from "react";

function App() {
  return (
    <div className="App">
      <h1>Hello Ahmed</h1>
      <button class="btn">
        Notification <span class="badge badge-primary"></span>
      </button>
      <button
        type="button"
        class="btn btn-secondary"
        data-toggle="tooltip"
        data-placement="top"
        title=""
      >
        Button name
      </button>
    </div>
  );
}

export default App;
